        private void OnClickTestShareScreenButton()
        {
            StartCoroutine(DelayShare());
        }

        private IEnumerator DelayShare()
        {
            yield return new WaitForEndOfFrame();

            string imageBase64 = HTMLCanvas.GetScreenShotBase64();

            //string imageBase64 = HTMLCanvas.ToImageBase64("image/png", 1);

            // delay 5 frame to make sure the image is ok
            yield return 1;
            yield return 1;
            yield return 1;
            yield return 1;
            yield return 1;

            Dictionary<string, object> p = new Dictionary<string, object>();
            p.Add("intent", "SHARE");
            p.Add("image", imageBase64);
            p.Add("text", "Share Facebook Instant Game Exporter Screenshot");
            p.Add("data", new Dictionary<string, object>());

            FBInstant.shareAsync(p, null);
        }

